INSERT INTO `news` VALUES ('1649379296000', '14小时前', '国家卫健委 | 昨日新增本土确诊病例 1540 例', '4月7日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例1576例。其中境外输入病例36例（广西10例，四川9例，广东5例，上海4例，福建2例，云南2例，天津1例，黑龙江1例，江西1例，山东1例），含10例由无症状感染者转为确诊病例（四川9例，山东1例）；本土病例1540例（上海824例，其中浦东新区306例、松江区107例、闵行区96例、金山区72例、徐汇区40例、奉贤区', 'https://content-static.cctvnews.cctv.com/snow-book/index.html?item_id=7180318700591050692&toc_style_id=feeds_default');
INSERT INTO `news` VALUES ('1649375162000', '15小时前', '上海 | 昨日新增本土确诊病例 824 例', '上海市卫健委今早（8日）通报：2022年4月7日0—24时，新增本土新冠肺炎确诊病例824例和无症状感染者20398例，其中323例确诊病例为此前无症状感染者转归，121例确诊病例和19798例无症状感染者在隔离管控中发现，其余在相关风险人群排查中发现。新增境外输入性新冠肺炎确诊病例4例和无症状感染者3例，均在闭环管控中发现。\n2022年4月7日0—24时，新增本土新冠肺炎确诊病例824例，含32', 'https://content-static.cctvnews.cctv.com/snow-book/index.html?item_id=10943600350659659868&toc_style_id=feeds_default');
INSERT INTO `news` VALUES ('1649379140000', '14小时前', '吉林 | 昨日新增本土确诊病例 617 例', '4月7日0—24时，吉林省新增本土确诊病例617例（轻型583例、普通型32例、重症2例），其中长春市474例（含61例无症状感染者转为确诊病例）、吉林市136例、白城市4例、白山市2例、四平市1例；新增本土无症状感染者1649例，其中长春市1553例、吉林市92例、白城市2例、四平市1例、白山市1例。以上感染者均已转运至定点医疗机构隔离治疗，对以上人员的密切接触者、次密切接触者均已开展追踪排查，', 'https://content-static.cctvnews.cctv.com/snow-book/index.html?item_id=10813912994238034239&toc_style_id=feeds_default');
INSERT INTO `news` VALUES ('1649381059000', '14小时前', '福建 | 昨日新增本土确诊病例 20 例', '4月7日0—24时，福建省报告新增境外输入确诊病例2例（均为厦门市报告）。\n当日报告新增境外输入无症状感染者0例；解除隔离3例。\n截至4月7日24时，福建省累计报告境外输入确诊病例900例，目前住院35例，无死亡病例；现有报告境外输入无症状感染者尚在隔离医学观察21例。\n4月7日0—24时，福建省新增报告本土确诊病例20例（泉州19例，厦门1例，其中无症状转确诊14例）。\n当日新增报告本土无症状感', 'https://content-static.cctvnews.cctv.com/snow-book/index.html?item_id=2580606016454361607&toc_style_id=feeds_default');
INSERT INTO `news` VALUES ('1649376659000', '15小时前', '广东 | 昨日新增本土确诊病例 7 例', '4月7日0—24时，广东全省新增本土确诊病例7例（其中2例为无症状感染者转确诊），广州报告3例，佛山报告3例，湛江报告1例；新增本土无症状感染者4例，广州报告1例，佛山报告2例，湛江报告1例。\n广东全省新增境外输入确诊病例5例，广州报告2例，分别来自新加坡和阿联酋；深圳报告2例，均来自中国香港；佛山报告1例，来自沙特阿拉伯。新增境外输入无症状感染者34例，广州报告4例，2例来自阿联酋，其余2例分别', 'https://content-static.cctvnews.cctv.com/snow-book/index.html?item_id=3911971169908409593&toc_style_id=feeds_default');

